import React from 'react';

function Marketplace() {
  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold">Marketplace</h1>
      <p>Browse and buy eco-friendly products.</p>
    </div>
  );
}

export default Marketplace;
